import React from "react";
import AddToDo from './addToDo'
import Row from './row';

var titles = [];
var checked = [];

async function fetchPosts() {
    try {
      const rawPosts = await fetch("https://todo-checkpoint-api.herokuapp.com/api/todos/mauricio")
      const posts = await rawPosts.json()
      for (var i = 0; i < posts.length; i++) {
          titles.push(posts[i]["title"]);
        //console.log(posts[i]["title"]);
        console.log(posts[i]["checked"]);
        checked.push(posts[i]["checked"]);
      }
      return posts
    }
    catch(e){
      console.log("error on getting data: ", e)
    }
}

fetchPosts();

class TodosPage extends React.Component {

render() {
    return (
        <div>
            <AddToDo></AddToDo>
            <br></br>
            <Row text11="Run" isChecked="true"></Row>

        </div>
    )
}
}

export default TodosPage;
